def prime_factors(lst):
    def prime_factors_single(number):
        i = 2
        factors = set()
        while i * i <= number:
            if number % i:
                i += 1
            else:
                number //= i
                factors.add(i)
        if number > 1:
            factors.add(number)
        return factors
    return prime_factors_single(lst[828])
